import {   Route, RouterProvider,  createBrowserRouter, createRoutesFromElements } from 'react-router-dom';
import './App.css';
import Home from './pages/Home';
import About from './pages/About';
import NotFound from './pages/NotFound';
import Book from './pages/Book';
import Data from './pages/data';
import PlayersList from './components/PlayersList';
import Guy from './pages/guy';
import Test from './pages/test';
import BookList from './pages/BookList';
import Newbook from './pages/Newbook';

import NavLayout from './components/NavLayout';
import HelpLayout from './components/HelpLayout';

const router = createBrowserRouter(
  createRoutesFromElements(
    <Route path='/' element={<NavLayout/>}>
      <Route index element={<Home/>}/>
    <Route path='resposive' element={<Data/>}/>
    <Route path='test' element={<Guy/>}/>
      <Route path='player' element={<PlayersList/>}/>
      <Route path='about' element={<About/>}/>
      <Route path='about/book' element={<Book/>}/>
      <Route path='*' element={<NotFound/>}/>
      <Route path='malahala' element={<Test/>}>
      <Route path=':id' element={<BookList/>}/>
      <Route path='new' element={<Newbook/>}/>
      <Route path='help' element={<HelpLayout/>}></Route>


      </Route>
    </Route>
))

function App() {
  return (
   <RouterProvider router={router}/>
  );
}

export default App;
